//LXServiceHost   README
// 
//[****0]: RESIDENCE_NUM_<EXISTANCE> /       (uniqueResidenceNum  )
//[****1]: MYGEONICK_<EXISTANCE> / MyGeonick     (uniqueMyGeonick  )
//[****2]: GS1_CODE_<EXISTANCE> / GS1      (uniqueGS1Code  )
//[****3]: ACCESS_DENIED /       ,          
//[****4]: MEMBER_IS_<OWNERSHIP> /        (residenceOwner  )
//[****5]: RESIDENCE_NUM_<EXISTANCE> /        (Member   residenceIndex )
//
// 
//RegisterMember:  
//RegisterNewResidence:    
//UpdateResidence:   
//DeleteResidence:   
//PreConsentTo:    
//RealTimeConsentTo:    
//RequestForAddress:      
//DeregisterMember:   
//
//  
// (MyGeonick)        ,               .
//(ex) 15    15           .
//        >>               .
//             .
//
//
//--!       isActive              ?
//--!    vs   ?
//--! ERC-20  

pragma solidity ^0.5.0;

contract LXServiceHost {
    //     
    struct Residence {
        string myGeonick;
        string gs1;
        string streetAddress;
        string gridAddress;
        mapping(address => bool) accessApproved; // /    
    }

    // ()    
    struct Member {
        uint256 residencesNumCount;
        mapping(uint256 => uint256) residencesIndex; //EDIT address pk - index of array map
        uint256[] residencesNum;
    }

    address admin;
    mapping(uint256 => bool) uniqueResidencesNum; // ( )  
    mapping(string => bool) uniqueMyGeonick;      //   
    mapping(string => bool) uniqueGS1Code;        // gs1  
    mapping(uint256 => address) residencesOwner;  //  -    
    mapping(uint256 => Residence) residences;     //  -    
    mapping(address => Member) members;           // -    

    //ERC-20    
    //mapping(address => uint256) balances;

    event RegisterMember(address indexed _memberAddr, uint256 indexed _memberNum, bytes32 _blockhash);
    event RegisterNewResidence(address indexed _memberAddr, uint256 indexed _residencesNum, string _myGeonick, string _gs1, string _streetAddress, string _gridAddress, bytes32 _blockhash);
    event UpdateResidence(address indexed _memberAddr, uint256 indexed _residencesNum, string _myGeonick, string _gs1, string _streetAddress, string _gridAddress, bytes32 _blockhash);
    event DeleteResidence(address indexed _memberAddr, uint256 indexed _residencesNum, string _myGeonick, string _gs1, string _streetAddress, string _gridAddress, bytes32 _blockhash);
    event PreConsentTo(address indexed _requesterAddr, address indexed _memberAddr, uint256 _residencesNum, bool _approvalStatus, bytes32 _blockhash);
    event RealTimeConsentTo(address indexed _requesterAddr, address indexed _memberAddr, uint256 _residencesNum, bool _approvalStatus, bytes32 _blockhash);
    event RequestForAddress(address indexed _requesterAddr, uint256 _residencesNum, bytes32 _blockhash);
    event DeregisterMember(address indexed _memberAddr, uint256 indexed _memberNum, bytes32 _blockhash);


    //(constructor):      
    constructor() public {admin = msg.sender;}

    //[[   ]]
    //  
    //---
    //  _memberAddr:  SC
    //  _memberNum:  
    //---
    // bool:    /  (   )
    function registerMember(address _memberAddr, uint256 _memberPk) public returns(bool) {
        emit RegisterMember(_memberAddr, _memberPk, blockhash(block.number));
        return true;
    }

    // 
    //---
    //  _memberAddr:  SC
    //  _memberPk:  
    //---
    function deregisterMember(address _memberAddr, uint256 _memberPk) public returns(bool) {
        require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10093] ACCESS_DENIED");
        //remove all Residence info
        for(uint i = 0; i < members[_memberAddr].residencesNumCount; i++) {
            uint256 resNum = members[_memberAddr].residencesNum[i];
            uniqueMyGeonick[residences[resNum].myGeonick] = false;
            uniqueGS1Code[residences[resNum].gs1] = false;
            uniqueResidencesNum[resNum] = false;
            residencesOwner[resNum] = address(0);
            residences[resNum] = Residence({myGeonick: '', gs1: '', streetAddress: '', gridAddress: ''});
        }
        emit DeregisterMember(_memberAddr, _memberPk, blockhash(block.number));
        return true;
    }

    //[[    ]]
    //  
    //---
    //  _memberAddr:  SC
    //  _residencesNum:    
    //  _myGeonick:  
    //  _gs1: gs1
    //  _streetAddress:  
    //  _gridAddress: 
    //---
    //  bool:    /  (   )
    function registerResidence(
        address _memberAddr,
        uint256 _residencesNum, 
        string memory _myGeonick,
        string memory _gs1,
        string memory _streetAddress,
        string memory _gridAddress) public returns(bool) {
            require(!uniqueResidencesNum[_residencesNum], "[ERR-10010] RESIDENCE_NUM_EXISTS");
            require(!uniqueMyGeonick[_myGeonick], "[ERR-10011] MYGEONICK_EXISTS"); 
            require(!uniqueGS1Code[_gs1], "[ERR-10012] GS1_CODE_EXISTS");
            require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10013] ACCESS_DENIED");

            uniqueResidencesNum[_residencesNum] = true;
            uniqueMyGeonick[_myGeonick] = true;
            uniqueGS1Code[_gs1] = true;
            residences[_residencesNum] = Residence({myGeonick: _myGeonick, gs1: _gs1, streetAddress: _streetAddress, gridAddress: _gridAddress});
            residencesOwner[_residencesNum] = _memberAddr;
            //push > save index location > increase count
            members[_memberAddr].residencesNum.push(_residencesNum);
            members[_memberAddr].residencesNumCount += 1;
            members[_memberAddr].residencesIndex[_residencesNum] = members[_memberAddr].residencesNumCount;
            emit RegisterNewResidence(_memberAddr, _residencesNum, _myGeonick, _gs1, _streetAddress, _gridAddress, blockhash(block.number));
            return true;
    }

    //   
    //---
    //  _memberAddr:  SC
    //  _residencesNum:    
    //  _myGeonick:  
    //  _gs1: gs1
    //  _streetAddress:  
    //  _gridAddress: 
    //---
    function updateResidence(
        address _memberAddr,
        uint256 _residencesNum,
        string memory _myGeonick,
        string memory _gs1,
        string memory _streetAddress,
        string memory _gridAddress) public returns(bool) {
        require(uniqueResidencesNum[_residencesNum], "[ERR-10040] RESIDENCE_NUM_NOT_EXISTS");
        require(!uniqueMyGeonick[_myGeonick], "[ERR-10041] MYGEONICK_EXISTS"); 
        require(!uniqueGS1Code[_gs1], "[ERR-10042] GS1_CODE_EXISTS");
        require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10043] ACCESS_DENIED");
        require(residencesOwner[_residencesNum] ==  _memberAddr, "[ERR-10044] MEMBER_IS_NOT_OWNER");

        //       
        if (keccak256(bytes(_myGeonick)) == keccak256(bytes(""))) {
            _myGeonick = residences[_residencesNum].myGeonick;
        }
        if (keccak256(bytes(_gs1)) == keccak256(bytes(""))) {
            _gs1 = residences[_residencesNum].gs1;
        }
        if (keccak256(bytes(_streetAddress)) == keccak256(bytes(""))) {
            _streetAddress = residences[_residencesNum].streetAddress;
        }
        if (keccak256(bytes(_gridAddress)) == keccak256(bytes(""))) {
            _gridAddress = residences[_residencesNum].gridAddress;
        }
        residences[_residencesNum] = Residence({myGeonick: _myGeonick, gs1: _gs1, streetAddress: _streetAddress, gridAddress: _gridAddress});
        emit UpdateResidence(_memberAddr, _residencesNum, _myGeonick, _gs1, _streetAddress, _gridAddress, blockhash(block.number));
        return true;
    }

    //    ( )
    //---
    //  _memberAddrFrom:     SC
    //  _memberAddrTo:    SC
    //  _residencesNum:  
    //---
    function transferOwnershipTo(
        address _memberAddrFrom,
        address _memberAddrTo, 
        uint256 _residencesNum) public returns(bool) {
        require(uniqueResidencesNum[_residencesNum], "[ERR-10050] RESIDENCE_NUM_NOT_EXISTS");
        require(admin == msg.sender || _memberAddrFrom == msg.sender, "[ERR-10053] ACCESS_DENIED");
        require(residencesOwner[_residencesNum] == _memberAddrFrom, "[ERR-10054] FROM_MEMBER_IS_NOT_OWNER");
        require(members[_memberAddrFrom].residencesIndex[_residencesNum] != 0, "[ERR-10055] RESIDENCE_NUM_NOT_FOUND");
        //override and pop  ( 0  )
        uint256 deleteIndex = members[_memberAddrFrom].residencesIndex[_residencesNum]-1;
        uint256 deleteItem = members[_memberAddrFrom].residencesNum[deleteIndex];
        uint256 lastItem = members[_memberAddrFrom].residencesNum[members[_memberAddrFrom].residencesNumCount-1];
        members[_memberAddrFrom].residencesNum[deleteIndex] = lastItem;
        members[_memberAddrFrom].residencesIndex[deleteItem] = 0;
        members[_memberAddrFrom].residencesIndex[lastItem] = deleteIndex+1;
        members[_memberAddrFrom].residencesNumCount -= 1;
        members[_memberAddrFrom].residencesNum.pop();
        //--!.    MyGeonick 
        residences[_residencesNum].streetAddress = '';
        residences[_residencesNum].gridAddress = '';
        residencesOwner[_residencesNum] = _memberAddrTo;
        //   
        members[_memberAddrTo].residencesNum.push(_residencesNum);
        members[_memberAddrTo].residencesNumCount += 1;
        members[_memberAddrTo].residencesIndex[_residencesNum] = members[_memberAddrTo].residencesNumCount;
        return true;
    } 

    //   ( ,  README )
    //---
    //  _memberAddr:  SC
    //  _residencesNum:   
    //---
    function deleteResidence(
        address _memberAddr,
        uint256 _residencesNum) public returns(bool) {
        require(uniqueResidencesNum[_residencesNum], "[ERR-10060] RESIDENCE_NUM_NOT_EXISTS");
        require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10063] ACCESS_DENIED");
        require(residencesOwner[_residencesNum] == _memberAddr, "[ERR-10064] MEMBER_IS_NOT_OWNER");
        require(members[_memberAddr].residencesIndex[_residencesNum] != 0, "[ERR-10065] RESIDENCE_NUM_NOT_FOUND");
        //override and pop  ( 0  )
        uint256 deleteIndex = members[_memberAddr].residencesIndex[_residencesNum]-1;
        uint256 deleteItem = members[_memberAddr].residencesNum[deleteIndex];
        uint256 lastItem = members[_memberAddr].residencesNum[members[_memberAddr].residencesNumCount-1];
        members[_memberAddr].residencesNum[deleteIndex] = lastItem;
        members[_memberAddr].residencesIndex[deleteItem] = 0;
        members[_memberAddr].residencesIndex[lastItem] = deleteIndex+1;
        members[_memberAddr].residencesNumCount -= 1;
        members[_memberAddr].residencesNum.pop();
        //     
        uniqueResidencesNum[_residencesNum] = false;
        //mapping 
        residencesOwner[_residencesNum] = address(0);
        string memory _myGeonick = residences[_residencesNum].myGeonick;
        string memory _gs1 = residences[_residencesNum].gs1;
        string memory _streetAddress = residences[_residencesNum].streetAddress;
        string memory _gridAddress = residences[_residencesNum].gridAddress;
        residences[_residencesNum] = Residence({myGeonick: '', gs1: '', streetAddress: '', gridAddress: ''});
        emit DeleteResidence(_memberAddr, _residencesNum, _myGeonick, _gs1, _streetAddress, _gridAddress, blockhash(block.number));
        return true;
    }

    //   ()
    //---
    //  _memberAddr:  SC
    //  _requester      SC
    //  _residencesNum   
    //  _approvalStatus     true,    false
    //---
    function allowAccessTo(
        address _memberAddr,
        address _requester, 
        uint256 _residencesNum, 
        bool _approvalStatus) public returns(bool) {
        require(uniqueResidencesNum[_residencesNum], "[ERR-10070] RESIDENCE_NUM_NOT_EXISTS");
        require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10073] ACCESS_DENIED");
        require(residencesOwner[_residencesNum] == _memberAddr, "[ERR-10074] MEMBER_IS_NOT_OWNER");

        residences[_residencesNum].accessApproved[_requester] = _approvalStatus;
        emit PreConsentTo(_memberAddr, _requester, _residencesNum, _approvalStatus, blockhash(block.number));
        return true;
    }

    //    ()
    //---
    //  _requestFrom     SC
    //  _residencesNum    
    //---
    //  _myGeonick:  
    //  _gs1: gs1
    //  _streetAddress:  
    //  _gridAddress: 
    function getResidence(
        address _requestFrom,
        uint256 _residencesNum) public returns(
            bool _success, 
            string memory _myGeonick,
            string memory _gs1,
            string memory _streetAddress,
            string memory _gridAddress) {
        require(uniqueResidencesNum[_residencesNum], "[ERR-10080] RESIDENCE_NUM_NOT_EXISTS");
        require(admin == msg.sender || _requestFrom == msg.sender, "[ERR-10083] ACCESS_DENIED");
        //   , ,   success true   
        if(residences[_residencesNum].accessApproved[_requestFrom] || 
            residencesOwner[_residencesNum] == _requestFrom ||
            admin == _requestFrom) {
            //   () 
            emit RequestForAddress(_requestFrom, _residencesNum, blockhash(block.number));
            _myGeonick = residences[_residencesNum].myGeonick;
            _gs1 = residences[_residencesNum].gs1;
            _streetAddress = residences[_residencesNum].streetAddress;
            _gridAddress = residences[_residencesNum].gridAddress;
            _success = true;
        }
        //    success false    
        else {
            //     
            _myGeonick = '';
            _gs1 = '';
            _streetAddress = '';
            _gridAddress = '';
            _success = false;
        }
    }

    //    ()
    //---
    //  _requestFrom     SC
    //  _residencesNum    
    //---
    //  _myGeonick:  
    //  _gs1: gs1
    //  _streetAddress:  
    //  _gridAddress: 
    function getRealtimeConsent(
        address _requestFrom,
        uint256 _residencesNum) public returns(
            bool _success, 
            string memory _myGeonick,
            string memory _gs1,
            string memory _streetAddress,
            string memory _gridAddress) {
        require(uniqueResidencesNum[_residencesNum], "[ERR-10100] RESIDENCE_NUM_NOT_EXISTS");
        require(admin == msg.sender || _requestFrom == msg.sender, "[ERR-10103] ACCESS_DENIED");
        emit RequestForAddress(_requestFrom, _residencesNum, blockhash(block.number));
        emit RealTimeConsentTo(_requestFrom, residencesOwner[_residencesNum], _residencesNum, true, blockhash(block.number));
        _myGeonick = residences[_residencesNum].myGeonick;
        _gs1 = residences[_residencesNum].gs1;
        _streetAddress = residences[_residencesNum].streetAddress;
        _gridAddress = residences[_residencesNum].gridAddress;
        _success = true;
    }
    //[[      ]]
    //     (  )
    //---
    //  _memberAddr:  SC
    //---
    //  _residencesNumCount:     
    function getResidenceCount(address _memberAddr) public view returns(bool _success, uint256 _residencesNumCount) {
        require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10023] ACCESS_DENIED");
        _residencesNumCount = members[_memberAddr].residencesNumCount ;
        _success = true;
    }

    //      (  )
    //---
    //  _memberAddr:  SC
    //---
    //  _residenceList:     
    function getResidenceList(address _memberAddr) public view returns(bool _success, uint256[] memory _residenceList) {
        require(admin == msg.sender || _memberAddr == msg.sender, "[ERR-10033] ACCESS_DENIED");
        _residenceList = members[_memberAddr].residencesNum;
        _success = true;
    }

    //  gs1    
    //---
    //  _myGeonick:   
    //  _gs1:   gs1 
    //---
    function freeMyGeonick(string memory _myGeonick, string memory _gs1) public returns(bool _success) {
        require(admin == msg.sender, "[ERR-10113] ACCESS_DENIED");
        uniqueMyGeonick[_myGeonick] = false;
        uniqueGS1Code[_gs1] = false;
        return true;
    }
}
